  \"2015-07-10T00:26:26.962638\",\n\t\"name\": \"trauma-center-locations\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Statewide Trauma Centers. A trauma center
  is a facility that has made a committment to serve the trauma patient, has met the
  standards of the trauma system, and has obtained designation as a trauma center.
  Trauma centers are designated as either level 0 (not a trauma center), I, II, III,
  IV or V. nnFor more information, please see http://ndhealth.gov/EMS/ nnNorth Dakota
  Department of Health - Trauma Level DesignationnnLevel V Level V facilities are
  designated by the Department of Health with assistance of staff from the Level II
  facilities.  A Level V facility must provide evaluation, stabilization and appropriate
  diagnostics for each trauma patient presenting to their emergency room. When appropriate,
  these patients must be transferred to a higher level of care.  The facility must
  meet specific equipment requirements. Data from each of their trauma patients must
  be entered into the trauma registry for statistical analysis. The patient records
  are audited and reviewed to assure that quality patient care is given to every trauma
  patient. An ATLS certified physician, physicianu2019s assistant or nurse practitioner
  must be available 24 hours a day to care for injured patients.n nLevel IV Level
  IV facilities are held to the same standards as Level V, and additionally are required
  to have a physician rather than a physicianu2019s assistant or nurse practitioner
  available 24 hours a day to care for the injured patient. n nLevel III Level III
  trauma centers are verified by the American College of Surgeons. Level III facilities
  do not have the full availability of physician specialists available at a Level
  I or II facility, but do have resources for emergency resuscitation, surgery and
  intensive care of most trauma patients. The same care, equipment, data entry and
  performance improvement requirements remain as in Level IV and V.n nLevel II Level
  II trauma centers are verified by the American College of Surgeons. The Level II
  facilities in our state function at nearly the same level as a Level I facility.
  They attempt to assure 24 hours a day coverage of the various surgical specialists.
  \ They perform rigorous performance improvement, community education and injury
  prevention services.  Level II Trauma Medical Directors and Coordinators within
  North Dakota help in the designation process for the Level IV and V facilities in
  the state, and providing follow-up on patient care outcomes.n nLevel I Level I trauma
  centers are verified by the American College of Surgeons. A Level I Trauma Center
  provides the highest level of surgical care to trauma patients with requirements
  for various surgical specialists to be available 24 hours a day.  There are requirements
  for minimum annual volumes of severely injured patients.  Additionally, a Level
  I center has research requirements related to trauma and is a leader in trauma education,
  injury prevention, and is a referral resource for communities in nearby regions.\",\n\t\"license_title\":
